import React, { Component } from 'react';
import { Row, Col } from 'antd';


class Header extends Component {
  componentWillMount() {
    this.setState({
      userName: 'vortesnail'
    })
  }

  render() {
    return (
      <div>
        <Row>
          <Col span={24}>
            <span>欢迎，{this.state.userName}</span>
            <a href="#">退出</a>
          </Col>
        </Row>
        <Row>
          <Col span={4}>
            首页
          </Col>
          <Col span={20}>
            <span>2018-05-04</span>
            <span>晴转多云</span>
          </Col>
        </Row>
      </div>
    )
  }
}

export default Header;
